import React from 'react'
import ReactDOM from 'react-dom'

const Otsikko = (props) => {
    return (
      <div>
        <h1>{props.name}</h1>
      </div>
    )
  }

const Sisalto = (props) => {
    return (
      <div>
        <Osa osa1={props.osa1}/>
      </div>
    )
  }

const Yhteensa = (props) => {
    return (
      <div>
        <p>Yhteensä {props.yhteensa}</p>
      </div>
    )
  }

const Osa = (props) => {
    return (
      <div>
        <p>{props.osa1} {props.tehtavia1}</p>
      </div>
    )
  }


const App = () => {
  const kurssi = 'Half Stack -sovelluskehitys'
  const osa1 = 'Reactin perusteet'
  const tehtavia1 = 10
  const osa2 = 'Tiedonvälitys propseilla'
  const tehtavia2 = 7
  const osa3 = 'Komponenttien tila'
  const tehtavia3 = 14

  return (
    <div>
      <Otsikko name={kurssi} />
      <Sisalto osa1={osa1} osa2={osa2} osa3={osa3} tehtavia1={tehtavia1} tehtavia2={tehtavia2} tehtavia3={tehtavia3}/>
      <Yhteensa yhteensa={tehtavia1 + tehtavia2 + tehtavia3} />
    </div>
  )
}

ReactDOM.render(
  <App />,
  document.getElementById('root')
)
